from fractions import Fraction

ds = {} 
for idx, val in enumerate(source):
    ds[Fraction(idx)] = Fraction(val)


def extrapolate():
    d = []
    for key in ds:
        d.append((key/3, key))

    for entries in d:
        actual, original = entries 
        if not actual in ds:
            ds[actual] = ds[original]/5

